import React from 'react'
import Card from "react-bootstrap/Card";

function IntroCard() {
    return (
        <div>
            <Card style={{ width: '10%' }}>
                <Card.Body>This is some text within a card body.</Card.Body>
            </Card>
        </div>
    )
}

export default IntroCard
